  /** @name \u786E\u5B9A\u8FD9\u4E2A\u5217\u7684\u552F\u4E00\u503C */
  key?: string | number;
  /**
   * \u652F\u6301\u4E00\u4E2A\u6570\u7EC4\uFF0C[a,b] \u4F1A\u8F6C\u5316\u4E3A obj.a.b
   *
   * @name \u4E0E\u5B9E\u4F53\u6620\u5C04\u7684key
   */
  dataIndex?: string | number | (string | number)[];
  /** \u9009\u62E9\u5982\u4F55\u6E32\u67D3\u76F8\u5E94\u7684\u6A21\u5F0F */
  valueType?: ((entity: T, type: ProSchemaComponentTypes) => U) | U;

  /**
   * \u652F\u6301 ReactNode \u548C \u65B9\u6CD5
   *
   * @name \u6807\u9898
   */
  title?:
    | ((
        schema: ProSchema<T, U, Extra>,
        type: ProSchemaComponentTypes,
        dom: React.ReactNode,
      ) => React.ReactNode)
    | React.ReactNode;

  /** @name \u5C55\u793A\u4E00\u4E2A icon\uFF0Chover \u662F\u5C55\u793A\u4E00\u4E9B\u63D0\u793A\u4FE1\u606F */
  tooltip?: string | LabelTooltipType;

  /** @deprecated \u4F60\u53EF\u4EE5\u4F7F\u7528 tooltip\uFF0C\u8FD9\u4E2A\u66F4\u6539\u662F\u4E3A\u4E86\u4E0E antd \u7EDF\u4E00 */
  tip?: string;

  render?: (
    dom: React.ReactNode,
    entity: T,
    index: number,
    action: ProCoreActionType,
    schema: ProSchema<T, U, Extra>,
  ) => React.ReactNode;

  /**
   * \u8FD4\u56DE\u4E00\u4E2Anode\uFF0C\u4F1A\u81EA\u52A8\u5305\u88F9 value \u548C onChange
   *
   * @name \u81EA\u5B9A\u4E49\u7F16\u8F91\u6A21\u5F0F
   */
  renderFormItem?: (
    item: ProSchema<T, U, Extra>,
    config: {
      index?: number;
      value?: any;
      onSelect?: (value: any) => void;
      type: ProSchemaComponentTypes;
      defaultRender: (newItem: ProSchema<T, U, Extra>) => JSX.Element | null;
    },
    form: FormInstance,
  ) => React.ReactNode;

  /**
   * \u5FC5\u987B\u8981\u8FD4\u56DE string
   *
   * @name \u81EA\u5B9A\u4E49 render
   */
  renderText?: (text: any, record: T, index: number, action: ProCoreActionType) => any;

  fieldProps?: any;
  /** @name \u6620\u5C04\u503C\u7684\u7C7B\u578B */
  valueEnum?: ProSchemaValueEnumObj | ProSchemaValueEnumMap;

  /** @name \u4ECE\u670D\u52A1\u5668\u8BF7\u6C42\u679A\u4E3E */
  request?: ProFieldRequestData<ProSchema>;

  /** @name \u4ECE\u670D\u52A1\u5668\u8BF7\u6C42\u7684\u53C2\u6570\uFF0C\u6539\u53D8\u4E86\u4F1A\u89E6\u53D1 reload */
  params?: {
    [key: string]: any;
  };
  /** @name \u9690\u85CF\u5728 descriptions */
