    // \u8FD9\u91CC\u9700\u8981\u8FD4\u56DE\u4E00\u4E2A Promise,\u5728\u8FD4\u56DE\u4E4B\u524D\u4F60\u53EF\u4EE5\u8FDB\u884C\u6570\u636E\u8F6C\u5316
